import { Api } from "../common/api";

 const validateUser = async ({loginmodel}) => {
  try {
      const{data}=await Api.post('account/login',loginmodel);
      return data;
  } catch (ex) {
    console.log(ex);
  }
};
export default loginService={validateUser}
